INSERT INTO `md_cms_page` (`cms_page_id`, `cms_page_status`, `cms_page_page`, `cms_page_is_image`, `cms_page_is_image2`, `cms_page_is_image3`, `cms_page_name`, `cms_page_title`, `cms_page_content`, `cms_page_url`, `cms_page_image`, `cms_page_image2`, `cms_page_image3`, `cms_page_image_path`, `tutorial_video`, `tutorial_video_path`, `cms_page_createdon`, `cms_page_meta_title`, `cms_page_meta_keywords`, `cms_page_meta_description`) VALUES
(1, 1, 0, 0, 0, 0, 'No Parent', NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-19 10:14:46', NULL, NULL, NULL),
(2, 1, 1, 0, 0, 0, 'Home', NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, '2021-03-19 10:14:42', NULL, NULL, NULL),
(3, 1, 2, 1, 0, 0, 'Home-section-1', 'Experts Tutorials', '&lt;p&gt;Learn anywhere and any time. Elevate your business skills with our Experts Video Tutorials.&lt;/p&gt;', '', '0.58357700_1616147730_1.svg', NULL, NULL, 'assets/uploads/cms_page/', NULL, NULL, '2021-03-19 10:15:03', NULL, NULL, NULL),
(4, 1, 2, 1, 0, 0, 'Home-section-2', 'Learning Journey', '&lt;p&gt;Build your Business Plan, Get Funded. Step-by-step builder for your Business Plan &amp;amp; Investment Deck.&lt;/p&gt;', '', '0.89353300_1616148166_1.svg', NULL, NULL, 'assets/uploads/cms_page/', NULL, NULL, '2021-03-19 10:15:04', NULL, NULL, NULL),
(5, 1, 2, 1, 0, 0, 'Home-section-3', 'Consult with Experts', '&lt;p&gt;Work with Industry Experts for successful strategies and to overcome the challenges of difficult markets.&lt;/p&gt;', '', '0.74754000_1616148716_1.svg', NULL, NULL, 'assets/uploads/cms_page/', NULL, NULL, '2021-03-19 10:15:06', NULL, NULL, NULL),
(6, 1, 2, 0, 0, 0, 'You-are-ready', 'You\'re ready!', '&lt;p&gt;What has landed you here is your biggest strength, the desire to step into your vision. We offer you our five valuable attributes of&amp;nbsp;&lt;strong&gt;knowledge, skills, confidence, credibility&lt;/strong&gt;&amp;nbsp;and&amp;nbsp;&lt;strong&gt;networks.&lt;/strong&gt;&amp;nbsp;In return, we invite you to share with us your&amp;nbsp;&lt;strong&gt;courage, commitment, vision, achievement&lt;/strong&gt;&amp;nbsp;and&amp;nbsp;&lt;strong&gt;success.&lt;/strong&gt;&amp;nbsp;Founded in 2019 in the UAE, Mind Cloud Tribe is a unique platform of tutorials (videos, tools &amp;amp; tool-builders) to help you build your business plan as well as a network of experts and resources to work with. We are a tribe of like-minded people coming together to support you on your entrepreneurship journey.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Stepping into your vision requires a bold mindset, a set of skills, and the support of your &amp;quot;Tribe&amp;quot;&lt;/strong&gt;&lt;/p&gt;', '', '0.74754000_1616148716_1.svg', NULL, NULL, 'assets/uploads/cms_page/', NULL, NULL, '2021-03-19 10:18:04', NULL, NULL, NULL),
(7, 1, 2, 0, 0, 0, 'experts-tutorials-1', 'Experts Tutorials', '&lt;p&gt;&lt;strong&gt;Mind Cloud&lt;/strong&gt;&amp;nbsp;Tribe has gathered a group of successful and inspirational experts committed to sharing their knowledge and working with entrepreneurs towards solving problems and developing strategies for success.&lt;/p&gt;', '', '0.74754000_1616148716_1.svg', NULL, NULL, 'assets/uploads/cms_page/', NULL, NULL, '2021-03-19 10:19:50', NULL, NULL, NULL),
(8, 1, 2, 0, 0, 0, 'experts-tutorials-2', 'Null', '&lt;p&gt;&lt;strong&gt;Our video series&lt;/strong&gt;&amp;nbsp;is divided by&amp;nbsp;&lt;a href=&quot;javascript:;&quot;&gt;20+ Categories&lt;/a&gt;&amp;nbsp;and&amp;nbsp;&lt;a href=&quot;javascript:;&quot;&gt;30+ Experts,&lt;/a&gt;&amp;nbsp;allowing you to dig deeper into each subject matter. Discover what Expert Tutorials and Categories are the most viewed:&lt;/p&gt;', '', '0.74754000_1616148716_1.svg', NULL, NULL, 'assets/uploads/cms_page/', NULL, NULL, '2021-03-19 10:20:16', NULL, NULL, NULL),
(9, 1, 2, 0, 0, 0, 'learning-journey-1', 'Learning Journey', '&lt;p&gt;We have designed a practical, step-by-step journey of video-tutorials and tool-builders to guide you through building your&amp;nbsp;&lt;strong&gt;business plan&lt;/strong&gt;, starting with your Business Model Canvas, all the way to your&amp;nbsp;&lt;strong&gt;Investment Deck&lt;/strong&gt;.&lt;/p&gt;', '', '0.74754000_1616148716_1.svg', NULL, NULL, 'assets/uploads/cms_page/', NULL, NULL, '2021-03-19 10:26:10', NULL, NULL, NULL),
(10, 1, 2, 1, 0, 0, 'learning-journey-2', 'Null', '&lt;h5&gt;Journey Includes:&lt;/h5&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;i&gt;&lt;img src=&quot;http://localhost/mind-cloud/assets/images/icons/1.png&quot; /&gt;&lt;/i&gt;&amp;nbsp;Professional Certification&lt;/li&gt;\r\n	&lt;li&gt;&lt;i&gt;&lt;img src=&quot;http://localhost/mind-cloud/assets/images/icons/2.png&quot; /&gt;&lt;/i&gt;&amp;nbsp;16 Video Tutorials&lt;/li&gt;\r\n	&lt;li&gt;&lt;i&gt;&lt;img src=&quot;http://localhost/mind-cloud/assets/images/icons/3.png&quot; /&gt;&lt;/i&gt;&amp;nbsp;16 Tool-Builders&lt;/li&gt;\r\n	&lt;li&gt;&lt;i&gt;&lt;img src=&quot;http://localhost/mind-cloud/assets/images/icons/4.png&quot; /&gt;&lt;/i&gt;&amp;nbsp;16 Downloadable Tools&lt;/li&gt;\r\n&lt;/ul&gt;', '', '0.60620200_1616150396_1.png', NULL, NULL, 'assets/uploads/cms_page/', 'test161615079497.mp4', 'assets/uploads/cms_page/', '2021-03-19 10:46:34', NULL, NULL, NULL),
(11, 1, 2, 0, 0, 0, 'who-is-it-for', 'Who Is It For?', '&lt;p&gt;Looking to start a business and requiring direction&lt;/p&gt;', '', '0.60620200_1616150396_1.png', NULL, NULL, 'assets/uploads/cms_page/', 'test161615079497.mp4', 'assets/uploads/cms_page/', '2021-03-22 06:08:47', NULL, NULL, NULL),
(12, 1, 2, 1, 0, 0, 'who-is-it-for-1', 'NEW ENTREPRENEURS', '&lt;p&gt;Looking to start a business and requiring direction&lt;/p&gt;', '', '0.72046600_1616393661_1.png', NULL, NULL, 'assets/uploads/cms_page/', 'sample-5s161639363193.mp4', 'assets/uploads/cms_page/', '2021-03-22 06:14:21', NULL, NULL, NULL),
(13, 1, 2, 1, 0, 0, 'who-is-it-for-2', 'CORPORATE ENTREPRENEURS', '&lt;p&gt;Looking to launch a venture within their institution&lt;/p&gt;', '', '0.98282200_1616393749_1.png', NULL, NULL, 'assets/uploads/cms_page/', 'test161615079497.mp4', 'assets/uploads/cms_page/', '2021-03-22 06:15:49', NULL, NULL, NULL),
(14, 1, 2, 1, 0, 0, 'who-is-it-for-3', 'GROWTH ENTREPRENEURS', '&lt;p&gt;Looking to grow their business and up-skill their team&lt;/p&gt;', '', '0.49422700_1616393796_1.jpg', NULL, NULL, 'assets/uploads/cms_page/', 'test161615079497.mp4', 'assets/uploads/cms_page/', '2021-03-22 06:16:36', NULL, NULL, NULL),
(15, 1, 2, 1, 0, 0, 'why-join', 'WhyJoin?', '&lt;p&gt;&lt;strong&gt;No matter where you are&lt;/strong&gt;&amp;nbsp;in your entrepreneurial journey, Mind Cloud Tribe is your partner to bridge all the knowledge gaps, and be equipped to make the right decisions.&lt;/p&gt;', '', '0.35752200_1616394365_3.png', NULL, NULL, 'assets/uploads/cms_page/', 'test161615079497.mp4', 'assets/uploads/cms_page/', '2021-03-22 06:26:05', NULL, NULL, NULL),
